import { Grid, Typography } from '@mui/material';
import React from 'react';

const Skills = () => {
  return (
    <Grid
      container
      sx={{
        position: 'relative',
        backgroundColor: 'rgb(30, 30, 30)',
        px: { md: 10, xs: 0 },
        mt: { md: -2, xs: 3 },
        height: { xs: '80vh', md: '90vh' },
        overflow: 'hidden',
        display: 'flex',
        justifyContent: 'center',
        // alignItems: 'center', for straight height
      }}
    >
      <Typography
        variant="h2"
        sx={{
          color: 'white',
          textAlign: 'center',
          fontWeight: 600,
          fontFamily: 'inherit',
          fontSize: { md: '3rem', xs: '2rem' },
        }}
      >
        What i do
      </Typography>
      <Typography
        variant="h2"
        sx={{
          color: 'white',
          textAlign: 'center',
          // fontWeight: 600,
          fontFamily: 'inherit',
          fontSize: { md: '1rem', xs: '0.5rem' },
        }}
      >
        I am a skilled and passionate web designer with experience in
        creating visually appealing and user-friendly websites.
        I have a strong understanding of design and a keen eye for detail.
        I am proficient in HTML, CSS,JavaScript and Reactjs, as well as
        design software such as Adobe Photoshop
      </Typography>
    </Grid>
  );
};

export default Skills;
